const certstreamUrl = 'wss://certstream.calidog.io';
const certstreamSocket = new WebSocket(certstreamUrl);
var counter = 0;
var timerID = 0;
var allTxt = "Date;Heure;Note;caAuthority;Domaine\n";


function keepAlive() {
	var timeout = 20000;
	console.log("Activating keep alive");
	if (certstreamSocket.readyState == certstreamSocket.OPEN) {
		certstreamSocket.send('');
	}
	timerID = setTimeout(keepAlive, timeout);
}


function cancelKeepAlive() {
	console.log("Canceling keep alive");
	if (timerID) {
		clearTimeout(timerID);
	}
}


function displayStream() {
	console.log('Connecting to '+certstreamUrl+' ...');
	certstreamSocket.onopen = function() {
		console.log("Connection established to certstream");
		keepAlive();
	};
	certstreamSocket.onmessage = function(message) {
		let parsedMessage = JSON.parse(message.data);
		if (parsedMessage.message_type === "heartbeat") {
			return;
		}
		callback(parsedMessage);
	};
	certstreamSocket.onerror = function(err) {
		console.error(err)
	};
}


function stopStream() {
	certstreamSocket.close();
	certstreamSocket.onclose = function() {
		cancelKeepAlive();
	};
	if (allTxt.length !== 0) {
		download('results.csv', allTxt);
	}
	console.log("Closing connexion");
}
